import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import AboutUs from './components/AboutUs/AboutUs';
import {Route} from 'react-router-dom';
import CraftframeShop from './components/CraftframeShop/CraftframeShop';
import General from './components/General/General';
import Portfolio from './components/Portfolio/Portfolio';
import Price from './components/Price/Price';
import Reviews from './components/Reviews/Reviews';
import Discount from './components/Discount/Discount';
import LeaveARequest from './components/LeaveARequest/LeaveARequest';


function App() {
  return (
    <div className='App-wrapper'>
      <Header/>
      <Navbar/>
      <div className='App-wrapper-content'>
        <Route path='/aboutUs' render ={()=><AboutUs/>}/>
        <Route path='/craftframeShop' render ={()=><CraftframeShop/>}/>
        <Route path='/general' render={()=><General/>}/>
        <Route path='/portfolio' render={()=><Portfolio/>}/>
        <Route path='/price' render={()=><Price/>}/>
        <Route path='/reviews' render={()=><Reviews/>}/>
        <Route path='/discount' render={()=><Discount/>}/>
        <Route path='/leaveARequest' render={()=><LeaveARequest/>}/>
      </div>
    </div>
  );
}

export default App;
